import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Funny from "./Funny";

class Navbar extends Component {
    render() {
        return (
            <Router>
                <div>
                    <nav className="navBar">
                        <Link to="/">Funny</Link>
                        <Link to="/">Family</Link>
                        <Link to="/">Office</Link>
                        <Link to="/">Office</Link>
                    </nav>
                </div>
            </Router>
        );
    }
}

export default Navbar;
